import React from "react";

import { Button } from "antd"

const Header = () => {
    const [text, setText] = useState('')
    return (
        <>
            <Button type="dashed">test1</Button>
            <br /><br />
            <div />
            <input type="text" id="inputText" onChange={e => setText(e.target.value)} placeholder="text" />
            <br /><br />
            <textarea id="outputText" placeholder="Password" value={text} />
        </>
    )
}

export default Header
